import React from 'react';
import { Route, Routes } from 'react-router-dom'; 
import { Box } from '@mui/material';
import Homemain from './Auth/Homemain';
import Login from './Auth/login';
import Signup from './Auth/signup';
// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyDvUzdedAxpGhjTV9O9z08ajBp8oQgljeY",
  authDomain: "reactgym-446a2.firebaseapp.com",
  projectId: "reactgym-446a2",
  storageBucket: "reactgym-446a2.appspot.com",
  messagingSenderId: "442944567118",
  appId: "1:442944567118:web:719ec63a78004d62b1901f"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

const App = () => (
  <Box width="400px" sx={{ width: { xl: '1488px' } }} m="auto">
    <Homemain />
     <Routes>
      <Route path="/login" element={<Login/>} />
      <Route path="/signup" element={<Signup />} />
    </Routes>
  </Box>
);

export default App;
